export const Container = styled.div`
    display: grid;
    grid-template-columns: 5rem max-content 1fr repeat(3, max-content);
    grid-template-rows: max-content max-content max-content;
    height: 5rem;
    width: 100%;
    border-radius: .5rem;
    box-shadow: 2px 2px 2px 2px #888;
    padding: .5rem;
`

